      const childrenLists = [..._this.parentNode.parentNode.children]
      const siblings = childrenLists.filter(el => el !== _this.parentNode)
      siblings.forEach(el => {
        el.classList.remove('active')
      })


      e.stopPropagation();
      e.preventDefault();
