    var listHankookMasterIcon = $('#localWhereToBuyUs_googleMap').attr('data-listHankookMasterIcon');
    var listHankookMasterIconAltText = $('#localWhereToBuyUs_googleMap').attr('data-listHankookMasterIconAltText');
